import styled from "@emotion/styled"

const List = styled.ul`
  list-style-type: none;
  flex: 0 1 25%;
  font-size: 0.75em;

  li {
  }
`

export default function Timeline() {
  const timestamps = Array(24)
    .fill(undefined)
    .map((_, i) => `${i}`.padStart(2, "0"))

  return (
    <List>
      {timestamps.map(timestamp => (
        <React.Fragment>
          <li>{timestamp}:00</li>
          <li>{timestamp}:30</li>
        </React.Fragment>
      ))}
    </List>
  )
}
